import React from 'react';
import Navigation from './Navigation';
import Masterhead from './Masterhead';
import Portfoliosection from './Portfoliosection';
import About from './About';
import Contact from './Contact';
const App = () => (
    <div><Navigation/>
    <Masterhead/>
    <Portfoliosection/>
    <About/>
    <Contact/>
    </div>
)

export default App;
